import React from 'react';
import styled from 'styled-components';
import CancelButton from './CancelButton'

const ContainerButtons = () => {
  const Div = styled.div`
    border: 1px red solid;
    margin: auto;
    width: 375px;
    height: 50px;
    display: flex;
    align-items: center;
  `;

  return (
    <Div>
      <CancelButton />
    </Div>
  )

}

export default ContainerButtons
